import axios from "axios";
import { useState } from "react";
import "./style.css";
import { TableComp } from "./TableComp.js";

const Compress = () => {
  const [file, setFile] = useState(null);
  const [downloadLink, setDownloadLink] = useState("");
  const [compressionRatio, setCompressionRatio] = useState("");
  const [uploading, setUploading] = useState(false);
  const [records, setRecords] = useState([]);

    useEffect(() => {
      const fetchRecords = async () => {
        try {
          const response = await axios.get(
            "http://localhost:5000/compression-records"
          );
          setRecords(response.data);
        } catch (error) {
          console.error("Error fetching records:", error);
        }
      };

      fetchRecords();
    }, []);

  const handleFileChange = (e) => {
    setFile(e.target.files[0]);
  };

  const handleUpload = async () => {
    if (!file) {
      alert("Please select a file first.");
      return;
    }

    const formData = new FormData();
    formData.append("audio", file);

    setUploading(true);
    try {
      const response = await axios.post(
        "http://localhost:5000/compress",
        formData,
        {
          headers: {
            "Content-Type": "multipart/form-data",
          },
        }
      );

      const { compressedFile, compressionRatio } = response.data;
      const url = `http://localhost:5000/${compressedFile}`;

      setDownloadLink(url);
      setCompressionRatio(compressionRatio);
      setUploading(false);
    } catch (error) {
      console.error("Error uploading file:", error);
    }
  };

  const handleDownload = () => {
    const link = document.createElement("a");
    link.href = downloadLink;
    link.download = "compressed_audio.m4a";
    document.body.appendChild(link);
    link.click();
    document.body.removeChild(link);
  };
  return (
    <div>
      <div className="wrap">
        <div className="title1">Compress</div>
        <div className="custom-file-upload">
          <input type="file" accept="audio/*" onChange={handleFileChange} />

          <button onClick={handleUpload}>
            {uploading ? "Uploading..." : "Upload and Compress"}
          </button>
          {compressionRatio && (
            <div className="ratio">
              <p>Compression Ratio: {compressionRatio}%</p>
            </div>
          )}

          {downloadLink && (
            <div>
              <button onClick={handleDownload}>Download Converted Audio</button>
            </div>
          )}
        </div>
        
      </div>

  

    <div>
      <h1>Compression Records</h1>
      <table>
        <thead>
          <tr>
            <th>File Name</th>
            <th>Compression Ratio (%)</th>
            <th>Compressed File</th>
            <th>Date</th>
          </tr>
        </thead>
        <tbody>
          {records.map((record, index) => (
            <tr key={index}>
              <td>{record.fileName}</td>
              <td>{record.compressionRatio}</td>
              <td>
                <a
                  href={record.compressedFile}
                  target="_blank"
                  rel="noopener noreferrer"
                >
                  Download
                </a>
              </td>
              <td>{new Date(record.date).toLocaleString()}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  
    </div>
  );
};

export default Compress;
